import React, { Component, Fragment } from 'react';
import Navbar from '../UI/Navbar';

import './Home.css';

class Home extends Component {
    render () {
        return (
            <Fragment>
                <div className="home-wrapper">
                    <Navbar></Navbar>
                    <div className="container">
                        <div className="home-section">
                            section 1
                        </div>
                        <div className="home-section">
                            section 2
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default Home;
